import Todo from "./Todo"

function Todos ( {todos} ) {
    return (
    <div className="todos">
    { todos.map( ({todo}) => (
        <Todo todoText={todo.todoText}
            key={todo.todoId} />
    )) }
    </div>
    )
}
export default Todos
